/*
859. Buddy Strings
Easy
Topics
premium lock iconCompanies

Given two strings s and goal, return true if you can swap two letters in s so the result is equal to goal, otherwise, return false.
Swapping letters is defined as taking two indices i and j (0-indexed) such that i != j and swapping the characters at s[i] and s[j].
    For example, swapping at indices 0 and 2 in "abcd" results in "cbad".

Example 1:
Input: s = "ab", goal = "ba"
Output: true
Explanation: You can swap s[0] = 'a' and s[1] = 'b' to get "ba", which is equal to goal.

Example 2:
Input: s = "ab", goal = "ab"
Output: false
Explanation: The only letters you can swap are s[0] = 'a' and s[1] = 'b', which results in "ba" != goal.

Example 3:
Input: s = "aa", goal = "aa"
Output: true
Explanation: You can swap s[0] = 'a' and s[1] = 'a' to get "aa", which is equal to goal.

Constraints:
    1 <= s.length, goal.length <= 2 * 104
    s and goal consist of lowercase letters.
*/

use crate::Runnable; // Import the trait from the library root

pub struct Solution;

impl Solution {
    // you used LLM help you should be ashamed
    pub fn buddy_strings(s: String, goal: String) -> bool {
        if s.len() != goal.len() {
            return false;
        }
        let s_vec = s.chars().collect::<Vec<char>>();
        let goal_vec = goal.chars().collect::<Vec<char>>();

        let mismatched_pairs: Vec<(&char, &char)> = s_vec
            .iter()
            .zip(goal_vec.iter())
            .filter(|(val1, val2)| val1 != val2) // Keep only non-matching pairs
            .collect();

        if mismatched_pairs.is_empty() {
            use std::collections::HashMap;
            let mut hash_map: HashMap<char, i32> = HashMap::new();
            for i in s_vec {
                let entry = hash_map.entry(i).or_insert(0);
                *entry += 1;
            }

            for kv in hash_map.iter() {
                if *kv.1 > 1 {
                    return true;
                }
            }
        } else if mismatched_pairs.len() == 2 {
            if mismatched_pairs[0].1 == mismatched_pairs[1].0
                && mismatched_pairs[0].0 == mismatched_pairs[1].1
            {
                return true;
            }
        }

        false
    }
}

// Implement the Runnable trait for this specific solution
impl Runnable for Solution {
    fn run() {
        // This is the example code you wanted to move
        let res = Solution::buddy_strings("ab".to_string(), "ab".to_string());
        println!("{:?}", res);
    }
}

